import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { setTicketData } from "../../slices/tourSlice";
import { useParams } from "react-router-dom";

export default function MyTickets() {
  const {id} = useParams();

  const imgTour = useSelector((state) => state.tour.img);
  const titleTour = useSelector((state) => state.tour.title);
  const dataTour = useSelector((state) => state.datepicker.selectedDate);
  const timeTour = useSelector((state) => state.datepicker.selectedTime);
  const totalPrice = useSelector((state) => state.tour.totalPrice);
  const paymentMethod = useSelector((state) => state.tour.payment);
  const statusTour = useSelector((state) => state.tour.statusTour);
  const ticketsData = useSelector((state) => state.tour.ticketData);

  const dispatch = useDispatch();

 useEffect(() => {
  const ticket = {
    id : Number(id),
    img: imgTour,
    title: titleTour,
    date: dataTour,
    time: timeTour,
    price: totalPrice,
    payment: paymentMethod,
    status: statusTour,
  };

  console.log(ticket); 

  dispatch(setTicketData(ticket));
  
}, [id,imgTour,titleTour,dataTour,timeTour,totalPrice,paymentMethod,statusTour]);

  return (
    <section>
      <h3>My Tickets</h3>
      <section className="tickets">
        {ticketsData.map((ticket, index) => (
          <table key={index}>
            <thead>
              <tr>
                
                <th>Tour Name</th>
                
                <th>Payment Method</th>
                <th>Price</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td>
                  <img
                    style={{ height: "6.8em", width: "10em", borderRadius: "0.75em" }}
                    src={ticket.img}
                    alt={ticket.title}
                  />
                </td>
                <td>{ticket.title}</td>
                <td>{ticket.date}</td>
                <td>{ticket.time}</td>
                <td>{ticket.payment}</td>
                <td>{ticket.status}</td>
                <td>{ticket.price}â‚¬</td>
              </tr>
            </tbody>
          </table>
        ))}
      </section>
    </section>
  );
}
